import React from 'react';
import BtnNavigate from '../btnNavigate/BtnNavigate';
import './list.css';
import { ROUTES } from '../../constants/constUrls';
import useListStudent from '../../hooks/useListStudent';
import useCities from '../../hooks/useCities';

const List: React.FC = () => {
    const listStudent = useListStudent();
    const cities = useCities();
    return (
        <div className="list-container">
            <BtnNavigate
                url={ROUTES.HOME}
                text='חזרה לעמוד הראשי'
            />
            <h2>רשימת משתמשים רשומים</h2>
            <ul>
                {listStudent && listStudent.length > 0 ? (
                    listStudent.map((data, index) => {
                        const cityName = cities?.find((city) => city.cityID === data.cityID);
                        return (<li key={index}>
                            שם מלא: {data.firstName} {data.lastName}
                            <br />
                            תאריך יום הולדת: {data.dateOfBirth}
                            <br />
                            תעודת זהות: {data.israeliID}
                            <br />
                            עיר: {cityName ? cityName.cityName : ''}
                        </li>)
                    }

                    ))
                    : (
                        <p>אין נתונים להציג</p>
                    )}
            </ul>
        </div>
    );
};

export default List;
